(function () {
  document.addEventListener('DOMContentLoaded', () => {
    const { setValue, addEventListener, querySelector } = window.dynamicFields.DynamicFieldsExamples_Quill_Value;
    const element = querySelector('.editor');
    const quill = new Quill(element, { theme: "snow" });
    quill.on('text-change', (delta, oldDelta, source) => {
      const fullDelta = quill.getContents();
      setValue({ 'text': quill.getText(), 'delta': fullDelta });
    });
    addEventListener('value', (object) => {
      quill.setContents(object?.delta ?? {});
    }, {init: true});
  });
})();
